import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './components/Header/Header';
import Main from './components/Main/Main';
import {Switch, Route, Redirect} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Header/>
      <Switch>
      <Main/>
      </Switch>
    </div>
  );
}

export default App;
